import React from 'react';
import logo from './logo.svg';
import Vote from "./components/Vote/Vote";
import './App.css';

function App() {

	fetch('localhost:3000/index', { method: 'POST' }).then(res => res.json()).then()

	return (
		<div className="App">
			<Vote />
		</div>
	);
}

export default App;
